import React from "react";
import { useEffect, useState } from "react";

function App() {

  const [backendData, setBackendData] = useState([{}]);

  useEffect(() => {
    fetch("/api")
      .then((response) => response.json())
      .then((data) => setBackendData(data));
  }, []);

  return (
    <div>
      <h1>Hello World</h1>
      <h2>Backend data:</h2>
      <ul>
        {backendData.users &&
          backendData.users.map((user, index) => <li key={index}>{user}</li>)}
      </ul>
      <div className="App">
        <header className="App-header">
          <h1>Interfaz de Usuario</h1>
          <button onClick={handleEmulate}>Emular</button>
        </header>
      </div>
    </div>
  );
}

function handleEmulate() {
  // Aquí puedes realizar una solicitud al servidor Node.js para iniciar la emulación
  fetch('/emulate')
    .then(response => response.text())
    .then(data => console.log(data))
    .catch(error => console.error('Error:', error));
}

export default App;
